import React from 'react';
import logo from './logo.svg';
import './App.css';
import Calendar from './Calendar';
import {Members} from './Members';
function App() {
  console.log(Members);

  onClickMember = (member) => {
    console.log(member);
  }
  let displayUsers = Members.members.map((item)=>{
  return <li className="list-group-item" onClick={()=>onClickMember(item)} key={item.id}>{item.real_name}</li>
  })
  return (
    <div className="App">
      {/* <div className="calendar-rectangle">
        <div id="calendar-content" className="calendar-content"><Calendar/></div>
      </div> */}
      <button type="button" className="btn btn-primary" data-toggle="modal" data-target="#myModal">
  Open modal
</button>
<div className="container">
  <h2>Basic List Group</h2>
  <ul className="list-group">
    {displayUsers}
  </ul>
</div>

<div className="modal" id="myModal">
  <div className="modal-dialog">
    <div className="modal-content">

      <div className="modal-header">
        <h4 className="modal-title">Modal Heading</h4>
        <button type="button" className="close" data-dismiss="modal">&times;</button>
      </div>


      <div className="modal-body">
      <div className="calendar-rectangle">
        <div id="calendar-content" className="calendar-content"><Calendar/></div>
      </div>
      </div>

      <div className="modal-footer">
        <button type="button" className="btn btn-danger" data-dismiss="modal">Close</button>
      </div>

    </div>
  </div>
</div>
    </div>
  );
}

export default App;
